      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT + col2 * ( - 69 ) BETWEEN + col2 * 29 AND ( col0 * + col1 + + CAST ( NULL AS REAL ) );
  - name: tab2

outputs:
